значає, що будуть використовуватися дозволи від глобальної конфігурації, батьківської групи і категорії<br /><em>Відмова</em> означає, що незалежно від налаштувань глобальної конфігурації, батьківської групи або категорії, при редагуванні група не застосувати цю дію до цього елемента.<br /><em>Дозволено</em> — означає, що група  буде у стані застосувати цю дію до цього елемента (але якщо це суперечить глобальній конфігурації, батьківській групі або категорії, то це не буде мати впливу; конфлікт буде відмічено <em>Не дозволено (Закрито)</em> під розрахунковими налаштуваннями)<br />2. Якщо Ви вибрали нове налаштування, то натисніть <em>Зберегти</em> для оновлення розрахункових налаштувань.','/var/www/vhosts/zdorovya.in.ua/dilovaif.cruks.eu/language/uk-UA/uk-UA.lib_joomla.ini'),(1604,'JLIB_RULES_SETTINGS_DESC','Налаштування дозволів для цієї групи користувачів.','/var/www/vhosts/zdorovya.in.ua/dilovaif.cruks.eu/language/uk-UA/uk-UA.lib_joomla.ini'),(1605,'JLIB_STEMMER_INVALID_STEMMER','Неприпустимий парадигматичний тип %s','/var/www/vhosts/zdorovya.in.ua/dilovaif.cruks.eu/language/uk-UA/uk-UA.lib_joomla.ini'),(1606,'JLIB_UNKNOWN','Невідомо','/var/www/vhosts/zdorovya.in.ua/dilovaif.cruks.eu/language/uk-UA/uk-UA.lib_joomla.ini'),(1607,'JLIB_UPDATER_ERROR_COLLECTION_FOPEN','Установка PHP allow_url_fopen відключена. Цей параметр повинен бути увімкнутий для роботи оновлення.','/var/www/vhosts/zdorovya.in.ua/dilovaif.cruks.eu/language/uk-UA/uk-UA.lib_joomla.ini'),(1608,'JLIB_UPDATER_ERROR_COLLECTION_OPEN_URL','Оновлення пакету: Неможливо відкрити %s','/var/www/vhosts/zdorovya.in.ua/dilovaif.cruks.eu/language/uk-UA/uk-UA.lib_joomla.ini'),(1609,'JLIB_UPDATER_ERROR_COLLECTION_PARSE_URL','Оновлення пакету: Не вдалося розібрати %s','/var/www/vhosts/zdorovya.in.ua/dilovaif.cruks.eu/language/uk-UA/uk-UA.lib_joomla.ini'),(1610,'JLIB_UPDATER_ERROR_EXTENSION_OPEN_URL','Оновлення розширення: Неможливо відкрити %s','/var/www/vhosts/zdorovya.in.ua/dilovaif.cruks.eu/language/uk-UA/uk-UA.l