 being a CCK to an Application Builder. Apps are extensions for ZOO which are optimized for different purposes and types of content catalogs. ZOO offers a wide range of apps to get you started right away. There is a blog, a product catalog, a cookbook, a business directory, a documentation, a download archive and a movie database app!<\\/p>\\r\\n<ul class=\\\"uk-grid uk-grid-width-medium-1-2 uk-grid-width-large-1-4\\\" data-uk-grid-margin=\\\"\\\" data-uk-grid-match=\\\"{target:\'.uk-panel\'}\\\">\\r\\n<li><a class=\\\"uk-panel uk-panel-box uk-text-center uk-link-reset\\\" style=\\\"min-height: 163px;\\\" href=\\\"{zoofrontpage: 1 output: url}\\\"> <img src=\\\"images\\/yootheme\\/zoo\\/zoo_apps_blog.png\\\" alt=\\\"ZOO Blog\\\" width=\\\"170\\\" height=\\\"120\\\" \\/><\\/a>\\r\\n<h3 class=\\\"uk-h4 uk-margin-top\\\">Blog<\\/h3>\\r\\n<\\/li>\\r\\n<li><a class=\\\"uk-panel uk-panel-box uk-text-center uk-link-reset\\\" style=\\\"min-height: 163px;\\\" href=\\\"{zoofrontpage: 3 output: url}\\\"> <img src=\\\"images\\/yootheme\\/zoo\\/zoo_apps_productcatalog.png\\\" alt=\\\"ZOO Product Catalog\\\" width=\\\"170\\\" height=\\\"120\\\" \\/><\\/a>\\r\\n<h3 class=\\\"uk-h4 uk-margin-top\\\">Product Catalog<\\/h3>\\r\\n<\\/li>\\r\\n<li><a class=\\\"uk-panel uk-panel-box uk-text-center uk-link-reset\\\" style=\\\"min-height: 163px;\\\" href=\\\"{zoofrontpage: 6 output: url}\\\"> <img src=\\\"images\\/yootheme\\/zoo\\/zoo_apps_cookbook.png\\\" alt=\\\"ZOO Cookbook\\\" width=\\\"170\\\" height=\\\"120\\\" \\/><\\/a>\\r\\n<h3 class=\\\"uk-h4 uk-margin-top\\\">Cookbook<\\/h3>\\r\\n<\\/li>\\r\\n<li><a class=\\\"uk-panel uk-panel-box uk-text-center uk-link-reset\\\" style=\\\"min-height: 163px;\\\" href=\\\"{zoofrontpage: 2 output: url}\\\"> <img src=\\\"images\\/yootheme\\/zoo\\/zoo_apps_moviedatabase.png\\\" alt=\\\"ZOO Movie Database\\\" width=\\\"170\\\" height=\\\"120\\\" \\/><\\/a>\\r\\n<h3 class=\\\"uk-h4 uk-margin-top\\\">Movie Database<\\/h3>\\r\\n<\\/li>\\r\\n<li class=\